import "../assets/sass/components/main-section/main-section.scss";
import React from "react";

function TextBoxContainer() {
  return (
    <div id="text-box-container">
      <span id="text-box-message"></span>
      <span id="from"></span>
      <span id="date"></span>
    </div>
  );
}

export default TextBoxContainer;
